import React from 'react';
import Tour from './Tour';
import styles from './Tour.module.css';
const Tours = ({ tours }) => {

  return (
    <div className={styles.title}  >
      <h2>Tourse setup</h2>
    {/* mapping */}
    <div>
      {tours.map((tour)=>{
        return (
          <Tour />
        )
      })}
    </div>
    </div>
  );
};

export default Tours;
